import React from 'react';
import './ImageCarousel.css'
export const ImageCarousel = () => {
  return (
    <section id="carousel">
      <div id="carouselExampleSlidesOnly" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img className="d-block w-100" src="./assets/imageCarousel/image1.webp" alt="..." />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src="./assets/imageCarousel/image2.jpg" alt="..." />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src="./assets/imageCarousel/image3.jpg" alt="..." />
          </div>
        </div>
      </div>
    </section>
  );
};
